import { Link } from "react-router-dom";
import MainNavigation from "../components/MainNavigation";
import Button from "../components/Button";

function HomePage() {
    return (
        <>

            <h1>Annie Teng</h1>
            <p>
            Detail-oriented project manager with 5 years of experience. 
            </p>
            <p>
            Adept at overseeing QA testing, conducting sprint planning based on engineers' capacities, and collaborating with Product and Engineering teams to effectively meet project deadlines.
            </p>
            <Button>
                Find out more about my experience
            </Button>
        </>

    )
}

export default HomePage;
